import React from 'react';
import BemVindo from '../../assets/videos/bemVindo.mp4';
import './Home.css'; // Importar o CSS para estilização

function Home() {
  return (
    <div className="home-container">
    <div className="video-container">
      <video
        src={BemVindo}
        autoPlay
        loop
        muted
        controls={false}
        className="welcome-video"
      />
    </div></div>
  );
}

export default Home;
